mation &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 153 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 14.19 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 15.24 s &lt;/li&gt;\n&lt;li&gt; transfer time: 59.31 ms &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.2.236:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 4 &lt;/li&gt;\n          &lt;li&gt; Threads: 96 &lt;/li&gt;\n          &lt;li&gt; Memory: 690.94 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport yaml\nfrom dask_interface import Initialization\nimport dask\nimport dask.array as da\nfrom dask.distributed import performance_report\nimport time\n\ndef Derivee(F, dx, periodic=0):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n              periodic = 1 if F is periodic\n       Output: dFdx = first derivative of F\n    \"\"\"\n    nx   = len(F)\n    #dFdx = 0. * F\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3:nx - 1] - F[1:nx - 3] - (F[4:nx] - F[0:nx - 4]) / 8.)\n    return dFdx\n\n# Get configuration\nwith open(r'config.yml') as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    Sworkers = data[\"workers\"]\n\n# Scheduler file name \nscheduler_info = 'scheduler.json'\n\n# Initialize the Deisa Adaptor \nAdaptor = Initialization(Sworkers, scheduler_info)\n\n# Check if client version is compatible with scheduler version\nAdaptor.client.get_versions(check=True)\n\n# Get data descriptor as a dict of Dask arrays\narrays = Adaptor.get_data()\n\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n   t = time.time()\n   # Get the Dask array global_t\n   gt = arrays[\"global_t\"]    \n   #gt = gt.rechunk({0: 1})\n   #print(gt.chunks)\n   # Construct a lazy task graph \n   der = Derivee(gt[::2], 1) \n   cpt =  da.linalg.norm(der, axis=(1,2))\n\n   # Submit the task graph to the scheduler\n   s = Adaptor.client.compute(cpt)\n   # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it.  \n   print(s.result(), flush=True)\n\nprint(\"Done in \", time.time() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{},"id":"1318","type":"DatetimeTickFormatter"},{"attributes":{},"id":"1376","type":"LinearScale"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"1276","type":"Line"},{"attributes":{},"id":"1374","type":"LinearScale"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"tools":[{"id":"1300"},{"id":"1301"},{"id":"1302"}]},"id":"1303","type":"Toolbar"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{},"id":"1457","type":"UnionRenderers"},{"attributes":{"start":0},"id":"1372","type":"DataRange1d"},{"attributes":{"coordinates":null,"data_source":{"id":"1213"},"glyph":{"id":"1394"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1396"},"nonselection_glyph":{"id":"1395"},"view":{"id":"1398"}},"id":"1397","type":"GlyphRenderer"},{"attributes":{},"id":"1316","type":"AllLabels"},{"attributes":{},"id":"1458","type":"Selection"},{"attributes":{"format":"0.0b"},"id":"1366","type":"NumeralTickFormatter"},{"attributes":{},"id":"1319","type":"AllLabels"},{"attributes":{"below":[{"id":"1378"}],"center":[{"id":"1381"},{"id":"1385"}],"height":150,"left":[{"id":
